import React from 'react';
import arola from './arola-logo.png';
import './App.css';
import Home from './Home';
import ContactScreen from './ContactPage';
import { Routes, Route } from 'react-router';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <Routes>
          <Route path="/" element={<Home/>}></Route>
          <Route path="/ContactPage" element={<ContactScreen/>}></Route>
        </Routes>

        <img src={arola} className="App-logo" alt="logo" />

        <br />
        <a
          className="App-link"
          href="/ContactPage.tsx"
          target="_blank"
          rel="noopener noreferrer"
        >
         Talk to us. We Listen.
        </a>
      </header>
    </div>
  );
}

export default App;
